import styled from 'styled-components';

export default styled.div`
    display: flex;
    flex-direction: column;
    .horizontal {
        display: flex;
        border: 1px solid red;
        height: 200px;
        width: 200px;
    }
    .vertical {
        border: 1px solid black;
        height: 100%;
        width: 50%;
    }

`;
